/*Table structure for table `attendance_report` */

DROP TABLE IF EXISTS `attendance_report`;

CREATE TABLE `attendance_report` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_no` varchar(20) NOT NULL,
  `employee_name` varchar(100) NOT NULL,
  `status` enum('Present','Late','Absent') NOT NULL,
  `date` date NOT NULL,
  `time_in` time DEFAULT NULL,
  `time_out` time DEFAULT NULL,
  `actual_time` time DEFAULT NULL,
  `worked_time` time NOT NULL,
  `overtime` time NOT NULL,
  `is_paid` int(11) DEFAULT 0,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `employee_no` (`employee_no`,`date`) USING BTREE,
  CONSTRAINT `attendance_report_ibfk_1` FOREIGN KEY (`employee_no`) REFERENCES `adding_employee` (`employee_no`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC;

