/*Table structure for table `cash_advance` */

DROP TABLE IF EXISTS `cash_advance`;

CREATE TABLE `cash_advance` (
  `cash_advance_id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_no` varchar(11) NOT NULL,
  `requested_amount` decimal(10,2) NOT NULL,
  `paid_amount` decimal(11,2) DEFAULT NULL,
  `remaining_balance` decimal(11,2) DEFAULT NULL,
  `status` enum('Pending','Approved','Partially Paid','Paid','Declined') DEFAULT 'Pending',
