/*Table structure for table `payroll` */

DROP TABLE IF EXISTS `payroll`;

CREATE TABLE `payroll` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `employee_no` varchar(255) NOT NULL,
  `rate_per_hour` decimal(10,2) DEFAULT NULL,
  `basic_per_day` decimal(10,2) DEFAULT NULL,
  `number_of_days` int(11) DEFAULT NULL,
  `total_hours` decimal(10,2) DEFAULT NULL,
  `gross_pay` decimal(10,2) DEFAULT NULL,
  `sss` decimal(10,2) DEFAULT NULL,
  `philhealth` decimal(10,2) DEFAULT NULL,
  `pagibig` decimal(10,2) DEFAULT NULL,
  `total_deductions` decimal(10,2) DEFAULT NULL,
  `cash_advance` decimal(10,2) DEFAULT NULL,
  `cash_advance_pay` decimal(10,2) DEFAULT NULL,
  `net_pay` decimal(10,2) DEFAULT NULL,
  `payment_date` date DEFAULT NULL,
